import React from 'react';
import {useState} from 'react'
import { Link, Route} from "wouter"
import './App.css'
import signinPage from './pages/signin'

function App() {
    return (
        <div className="App">
            <div className="img"><img src="/img/LabTool_logo.png" alt="LabTool_logo"/></div>
            <button className="sign_button signup" onClick="/signin">SIGN UP</button>
            <button className="sign_button signin">SIGN IN</button>
            <Route component={signinPage} path="/signin"></Route>
        </div>
        

    )
}

export default App
